import React from 'react';
import NavBar from '../../components/NavBar';
import SideBar from '../../components/SideBar';

function Home() {

    return (
        <div >
            <NavBar></NavBar>
            <div className="container-fluid">
                <div className="row">
                    <SideBar></SideBar>
                </div>
            </div>
        </div>
    );
}

export default Home;
